import './App.css';
import { useEffect } from 'react'
import axios from 'axios';

const baseURL = 'http://localhost:3001'

function App() {
  let message;
  useEffect(() => {
    message = axios
      .get(`${baseURL}/hello`)
      .then(res => res.data)  
  }, []);
  

  console.log(message)
  return (
    <>
      <h1>Hello, HCP</h1>
      <p>{message}</p>
    </>
  );
}

export default App;
